// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title Major Factory Contract
 * @notice HorseRace is a NFT horse racing metaverse based on pylogon
 * @notice ....
 *
 * @notice Website: https://horse-racing.io/
 * @notice Docs: https://horse-racing.gitbook.io/horse-racing-docs/
 * 
 * @dev Version: v1.0.1
 */
contract TransferProxy is Ownable {
    /** @notice Version of contract */
    string constant public LASTEST_VERSION = "v1.0.1";

    /** @notice Authentication of token transfer */
    mapping (address => bool) public _authentications;

    function grantAuthentication(address auth) public onlyOwner {
        _authentications[auth] = true;
    }

    function revokeAuthentication(address auth) public onlyOwner {
        _authentications[auth] = false;
    }

    function transferFrom(
        address token, address from, address to, uint256 amount
    ) public returns (bool) {
        require(_authentications[msg.sender], "NOT_ALLOWED");
        return IERC20(token).transferFrom(from, to, amount);
    }
}

